(728, 398, 'description', 'Comprising of 134 boutique residential apartments is situated within the Georges River Precinct and designed by local architect Mosca Pserras Architects. The site constraints challenged our development team to adopt an appropriate design response that delivered on quality, amenity and lifestyle. The three towers wrapping the site enabled the inclusion of a first-class private open space. The use of intricate metal work and exposed brick connects this building to its site’s industrial past. This rough materiality is contrasted with landscaping, where lush courtyards encourage neighbourly exchange between the building’s residents.'),
